// TslLexerInit initializes any static state used to implement TslLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewTslLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func TslLexerInit() {
	staticData := &TslLexerLexerStaticData
	staticData.once.Do(tsllexerLexerInit)
}

// NewTslLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewTslLexer(input antlr.CharStream) *TslLexer {
	TslLexerInit()
	l := new(TslLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &TslLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "TslLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

